import React, { Component } from 'react';


export default class Fetch extends Component {
  constructor(props){
    super(props);
    this.state ={
      players:""
    }
  }
  componentDidMount() {
    fetch('/players/1')
      .then(response => response.json())
      .then(data => {this.setState({players :data[0]})})
  }; 
  ;
  render() {
    return (
      <div>
       {players.first_name}
      </div>
    )
  }
}
